window.bookSummaryJSON = "<p>Ember discovers she is not only fae, but is one of the most feared type in existence—a Dae—considered an abomination among their kind. Her race is hunted down and killed because of their power.</p> <p>After her magic causes an electrical storm which destroys Seattle, Ember is on the run, pursued by the both the light and dark fae.</p> <p>The one she should fear the most is the sexy Dark Dweller who lied and betrayed her. Her enemy, Eli Dragen. His blood runs in her veins, creating a connection between them they can’t ignore. And neither can outrun.</p> <p>Ember knows she needs help, but she who can she trust? Torin, the Seelie Queen’s personal knight, who has sworn to keep her safe, or Eli, a deadly Dark Dweller, who wants to trade her to the Unseelie King.</p> <p>With a price on her head and a sexy Dark Dweller on her ass, she is constantly on the move.</p> <p>Ember becomes a pawn in the war between the Light and Dark and no matter what she chooses she will probably lose….</p> <p>Her life and everyone she loves.</p> <p>Bonus Material - <i>Beast in the Darkness</i></p> <p><i>Beast In The Darkness</i> (An Elighan Dragen Novelette)</p> <p>Plus two extra Eli POV Scenes!</p> <p>We know the story from Ember's POV, but what happens to Eli after Ember disappears? Or when he first see's her in the police station? Crawl inside Eli's mind and experience what he goes through. Be warned, his mind is not a warm fuzzy place to be....</p>"; 
